  function rgbToAnsi(r, g, b) {
  return `\x1b[38;2;${r};${g};${b}m`;
  }

  function interpolateColor(color1, color2, factor) {
  return color1.map((c1, i) => Math.round(c1 + (color2[i] - c1) * factor));
  }

  function applyDiagonalGradient(text, startColor, endColor) {
  const lines = text.split('\n');
  const maxLength = Math.max(...lines.map(line => line.length));
  const totalChars = maxLength + lines.length - 1;

  return lines.map((line, lineIndex) => {
    return '             ' + line.split('').map((char, charIndex) => {
      const factor = (lineIndex + charIndex) / totalChars;
      const color = interpolateColor(startColor, endColor, factor);
      return rgbToAnsi(...color) + char;
    }).join('');
  }).join('\n');
  }

